A000055.bio:
a Representative from Alabama; born in Haleyville, Winston County, 
Ala., July 22, 1965; B.A. Birmingham Southern College, Birmingham, Ala., 1987; 
J.D., Samford University, Birmingham, Ala., 1990; lawyer, private practice; 
Haleyville, Ala., municipal judge, 1992-1995; staff for Governor Fob James of 
Alabama, 1995-1996; elected as a Republican to the One Hundred Fifth and to the 
seven succeeding Congresses (January 3, 1997-present).

C001071.bio:
a Senator from Tennessee; born in Orangeburg, S.C., August 24, 1952; 
attended the public schools in Chattanooga, Tenn.; graduated with a bachelor of 
science degree in industrial management, University of Tennessee 1974; 
commercial real estate developer; construction company owner; unsuccessful 
candidate for the United States Senate 1994; commissioner, Tennessee Finance 
and Administration Department 1995-1996; mayor of Chattanooga 2001-2005; 
elected as a Republican to the United States Senate in 2006 for the term 
commencing January 3, 2007; reelected in 2012 for the term ending January 3, 
2019.

C001077.bio:
a Representative from Colorado; born in Fort Leonard Wood, Pulaski 
County, Mo., March 19, 1955; attended Aurora Central High School; B.A., 
University of Colorado, Boulder, Colo., 1979; United States Army, 1972-1974; 
United States Army Reserve, 1975-1978; United States Marine Corps, 1979-1982; 
United States Marine Corps Reserve, 1983-1994, 2005-2006; business owner; 
member of the Colorado state house of representatives, 1989-1994; member of the 
Colorado state senate, 1994-1998; Colorado state treasurer, 1999-2007; Colorado 
secretary of state, 2007-2008; elected as a Republican to the One Hundred 
Eleventh and to the two succeeding Congresses (January 3, 
2009-present).

F000457.bio:
a Senator from Minnesota; born in Manhattan, N.Y., May 21, 1951; 
A.B., Harvard University, Cambridge, Mass., 1973; screenwriter; comedian; 
author; radio talk show host; elected as a Democrat to the United States Senate 
in 2008 for the term beginning January 3, 2009, but the election was contested; 
following a June 30, 2009, decision in his favor by the Minnesota state supreme 
court, he took the oath of office and began service on July 7, 2009.

F000461.bio:
a Representative from Texas; born in Cheyenne, Laramie County, Wyo.; 
February 25, 1954; B.B.A., Texas A & M University, College Station, Tex., 
1976; M.B.A., Houston Baptist University, Houston, Tex., 1985; accountant; 
energy company executive; elected as a Republican to the One Hundred Twelfth 
Congress (January 3, 2011-present)

G000548.bio:
a Representative from New Jersey; born in Englewood, Bergen County, 
N.J., on July 9, 1959; B.A., Montclair State University, Montclair, N.J., 1981; 
J.D., Rutgers University Law School, Camden, N.J., 1984; lawyer, private 
practice; member of the New Jersey state house of representatives, 1990-2002; 
elected as a Republican to the One Hundred Eighth and to the five succeeding 
Congresses (January 3, 2003-present).

H001049.bio:
 (niece of Lawton M. Chiles, Jr.), 
a Senator from North Carolina; born in Shelby, N.C., May 26, 1953; 
B.A., Florida State University, 1975; J.D., Wake Forest University, 1978; 
banker; North Carolina State senator, 1999-2009; elected as a Democrat to the 
United States Senate in 2008 for the term ending January 3, 2015.

H001061.bio:
a Senator from North Dakota; born in Bismarck, N.D., March 13, 1957; 
graduated Dartmouth College, B.A., 1979; graduated Northwestern University, 
M.B.A., 1981; bank president and CEO; governor of North Dakota 2000-2010; 
elected as a Republican to the United States Senate in 2010 for the term ending 
January 3, 2017.

J000290.bio:
a Representative from Kansas; born in Topeka, Shawnee County, Kans.; 
June 10, 1963; A. A., Kansas State University, Manhattan, Kans., 1985; B. S., 
Weber State University, Ogden, Utah, 1985; accountant; member of Kansas state 
house of representatives, 1999-2001; member of Kansas state senate, 2001-2003; 
Kansas state treasurer, 2003-2008; elected as a Republican to the One Hundred 
Eleventh and to the succeeding Congress (January 3, 2009-present).

M000309.bio:
a Representative from New York; born Carolyn Cook in Brooklyn, Kings 
County, N.Y., January 5, 1944; graduated from Mineola High School, Garden City 
Park, N.Y., 1962; graduated, Glen Cove Nursing School, Glen Cove, N.Y., 1964; 
licensed practical nurse in ICU section, Glen Cove Hospital, Glen Cove, N.Y.; 
elected as a Democrat to the One Hundred Fifth and to the eight succeeding 
Congresses (January 3, 1997-present).

M001159.bio:
a Representative from Washington; born in Salem, Marion County, 
Oreg., May 22, 1969; B.A., Pensacola Christian College, Pensacola, Fla., 1990; 
M.B.A., University of Washington, Seattle, Wash., 2002; fruit orchard worker; 
member, Washington state house of representatives, 1994-2004; minority leader, 
2002-2003; elected as a Republican to the One Hundred Ninth Congress and to the 
three succeeding Congresses (January 3, 2005-present).

P000592.bio:
a Representative from Texas; born in Temple, Bell County, Tex., 
September 10, 1948; B.A., Abilene Christian University, Abilene, Tex., 1970; 
JD., University of Houston, Houston, Tex., 1973; United States Air Force 
Reserves, 1970-1976; lawyer; district attorney, Harris County, Tex., 1973-1981; 
judge, Harris County, Tex., 1981-2003; elected as a Republican to the One 
Hundred Ninth and to the four succeeding Congresses (January 3, 2005-present).

P000597.bio:
a Representative from Maine; born in Minneapolis, Hennepin County, 
Minn., April 2, 1955; attended University of Southern Maine, Portland, Maine, 
1973; B.A., College of the Atlantic, Bar Harbor, Maine, 1979; farmer; 
businesswoman; member, North Haven (Maine) board of assessors, 1981-1987; 
chairwoman, North Haven (Maine) board of assessors, 1982-1983; member, North 
Haven (Maine) planning board, 1981-1991; member, Maine state senate, 1992-2000; 
majority leader, Maine state senate, 1996-2000; unsuccessful candidate for the 
United States Senate in 2002; elected as a Democrat to the One Hundred Eleventh 
and to the succeeding Congress (January 3, 2009-present).

P000598.bio:
a Representative from Colorado; born in Boulder, Boulder County, 
Colo., May 12, 1975; A.B., Princeton University, Princeton, N. J., 1996; 
business owner; entrepreneur; member of Colorado board of education, 2001-2007; 
chairman of Colorado board of education, 2004-2005; elected as a Democrat to 
the One Hundred Eleventh and to the two succeeding Congresses (January 3, 
2009-present).

P000603.bio:
 (son of Ronald Ernest Paul), 
a Senator from Kentucky; born in Pittsburgh, Pa., January 7, 1963; 
attended Baylor University, 1981-1984; graduated Duke University, M.D., 1988; 
ophthalmologist; elected as a Republican to the United States Senate for the 
term ending January 3, 2017.

R000409.bio:
a Representative from California; born in Coronado, San Diego 
County, Calif., June 21, 1947; graduated from Palos Verdes High School, Palos 
Verdes Estates, Calif., 1965; attended Los Angeles Harbor College, Los Angeles, 
Calif., 1965-1967; B.A., California State University, Long Beach, Calif., 1969; 
M.A., University of Southern California, Los Angeles, Calif., 1971; journalist; 
assistant press secretary to the Reagan presidential campaigns of 1976 and 
1980; speechwriter and special assistant to President Ronald Reagan, 1981-1988; 
elected as a Republican to the One Hundred First and to the eleven succeeding 
Congresses (January 3, 1989-present).

R000591.bio:
a Representative from Alabama; born in Montgomery, Montgomery 
County, Ala., July 27, 1976; B.M., New York University, New York, N. Y., 1998; 
J.D., Samford University, Birmingham, Ala., 2001; lawyer, private practice; 
Montgomery, Ala., city council, 2003-2010; elected as a Republican to the One 
Hundred Twelfth and to the succeeding Congress (January 3, 2011-present).

R000595.bio:
a Senator from Florida; born in Miami, Fla., May 28, 1971; graduated 
University of Florida, B.S., 1993; graduated University of Miami, J.D., 1996; 
lawyer; West Miami City Commission 1998-2000; member of the Florida house of 
representatives 2000-2008; majority leader 2003-2006; speaker 2006-2008; 
elected as a Republican to the United States Senate for the term ending January 
3, 2017.

S001141.bio:
a Senator from Alabama; born in Hybart, Ala., December 24, 1946; 
attended the public schools; graduated from Huntingdon College, Montgomery 
1969; graduated from University of Alabama School of Law, Tuscaloosa 1973; 
admitted to the Alabama bar in 1973, and engaged in the practice of law in 
Russellville 1973-1975; served in the U.S. Army reserves, attaining the rank of 
captain 1973-1977; practiced law in Mobile 1977-1981; United States Attorney 
for the Southern District of Alabama 1981-1993; Alabama Attorney General 
1994-1996; elected as a Republican to the United States Senate in 1996; 
reelected in 2002, and again in 2008 for the term ending January 3, 2015.

S001183.bio:
a Representative from Arizona; born in Los Angeles, Los Angeles 
County, California, on March 3, 1962; A.A., Scottsdale Community College, 
Scottsdale, Ariz., 1985; B.S., Arizona State University, Tempe, Ariz., 1988; 
M.B.A., Arizona State University, Tempe, Ariz., 2005; business owner; realtor; 
financial consultant; member of the Arizona state house of representatives, 
1989-1994; member of the Arizona state board of equalization, 1995-2003; 
treasurer, Maricopa County, Ariz., 2004-2006; elected as a Republican to the 
One Hundred Twelfth and to the succeeding Congress (January 3, 
2011-present).

T000469.bio:
a Representative from New York; born in Amsterdam, Montgomery 
County, N.Y., June 18, 1949; B.S., Clarkson University, Potsdam, N.Y., 1971; 
public works engineer; state transportation agency employee; member, Montgomery 
County (N.Y.) board of supervisors, 1976-1983; chairman, Montgomery County 
(N.Y.) board of supervisors, 1981; member, New York state assembly, 1983-2007; 
president, New York state energy research and development authority, 2007-2008; 
elected as a Democrat to the One Hundred Eleventh and to the succeeding 
Congress (January 3, 2009-present).

W000809.bio:
a Representative from Arkansas; born in Russellville, Pope County, 
Ark., on February 18, 1957; B.A., Arkansas Tech University, Russellville, Ark., 
1979; Arkansas Army National Guard, 1979-2009; radio station manager; 
consultant; member of Rogers, Ark., city council, 1983-1984, and 1997-1998; 
mayor of Rogers, Ark., 1999-2010; elected as a Republican to the One Hundred 
Twelfth and to the succeeding Congress (January 3, 2011-present).
